import React from 'react'
import Header from './Header'
function Homepage() {
  return (
      <div>
        <Header />
        <h1 className=" w-1/4 text-xl">
        Curiosity is the fuel that propels your journey. You're always up for learning something new, whether it's mastering a skill, delving into a historical rabbit hole, or simply sparking a conversation with someone from a different walk of life. This blog serves as your personal playground for ideas, a space where you explore the world around you and share your unique perspective. pen_spark
        </h1>
    </div>
  )
}

export default Homepage
